demo.repl.help:
கிடைக்கும் கட்டளைகள்:
  @show              ─ கடைசி adaptive card சுருக்கத்தை காட்டு
  @json              ─ flow-இல் இருந்து பெறப்பட்ட மூல JSON மதிப்பை வெளியிடு
  @back              ─ முந்தைய தடுக்கப்பட்ட card/inputs நிலைக்கு திரும்பு
  @input <k>=<v>     ─ ஒரு input புலத்தை அமை அல்லது மேலெழுது
  @click <action_id> ─ கொடுக்கப்பட்ட action கொண்டு card-ஐ சமர்ப்பி
  @help              ─ இந்த உதவி உரையை அச்சிடு
  @quit              ─ REPL-இலிருந்து வெளியேறு
